def known_teams
  @known_teams ||= projects.flatten(1)
end

def teammates
  @worked_together ||= names.each_with_object Hash.new([].freeze) do |name, worked_with|
    teammates = known_teams.select { |team| team.include? name }.flatten.uniq
    teammates.delete name
    worked_with[name] = teammates
  end
end



# =====  grouping logic  ======

# the smaller this result is, the shorter the wait for solutions
def groups_size(n)
  names.combination(n).select { |group| group_unpaired? group }
end

def valid_groups?(groups)
  groups.inject(:|).size == names.size
end

def group_unpaired?(group)
  group.all? do |name|
    group.none? { |potential_teammate| teammates[name].include? potential_teammate }
  end
end

def groups_unpaired?(groups)
  groups.all? { |group| group_unpaired? group }
end

# Custom combination method (adds short-circuiting / debugging info)
# Returns sets of groups, with n groups in each set
# (where a set is actually an array, but using the terminology "groups of groups of names" is confusing,
#  so saying "sets of groups of names")
#
# For reference, the simpler initial version was:
#
#     def combinations(ary, n, idx=0)
#       return [[]] if n.zero?
#       return []   if ary.size <= idx
#       (idx...ary.size).each_with_object [] do |current_idx, all_combinations|
#         element = ary[current_idx]
#         child_combinations = combinations(ary, n-1, current_idx+1)
#         all_combinations.concat child_combinations.map { |child_combination| [element, *child_combination] }
#       end
#     end
#
#     describe 'combinations' do
#       example { combinations([1,2,3], 0).should =~ [[]]}
#       example { combinations([1,2,3], 1).should =~ [[1], [2], [3]]}
#       example { combinations([1,2,3], 2).should =~ [[1, 2], [1, 3], [2, 3]]}
#       example { combinations([1,2,3], 3).should =~ [[1, 2, 3]]}
#     end

def sets_of_groups(groups, n, debug=false, unavailable_names=[], index=0)
  return [[]] if n.zero?
  return []   if groups.size <= index
  (index...groups.size).each_with_object [] do |current_index, sets|
    debug and index == 0 and print "\rProgress: #{current_index}/#{groups.size}"
    group = groups[current_index]
    next if group.any? { |name| unavailable_names.include? name }
    new_unavailable_names = unavailable_names + group
    child_sets = sets_of_groups(groups, n-1, debug, new_unavailable_names, current_index+1)
    sets.concat child_sets.map { |child_set| [group, *child_set] }
  end
end

def all_possible_groups(options={debug: false})
  viable_groups = groups_size(4).map { |groups| groups.sort_by(&:to_s) }.sort_by(&:to_s)
  sets_of_groups(viable_groups, 6, options[:debug])
end

def remove_placeholder(sets_of_groups)
  sets_of_groups.map do |set|
    set.map do |group|
      group.reject { |name| name == :placeholder }
    end
  end
end


